cr.define(
    'extensions', function() {
      'use strict';

      const KioskDialog =
          Polymer({
            is: 'extensions-kiosk-dialog',
            properties:
                {

                  addAppId_: {type: String, value: null},

                  // TODO(scottchen): get data from kiosk setting
                  // (!settings.autoLaunchEnabled)
                  canEditAutoLaunch_: {
                    type: Boolean,
                    value: function() {
                      return true;
                    },
                  },

                  // TODO(scottchen): get data from kiosk setting
                  // (!settings.disableBailout)
                  bailoutEnabled_: {
                    type: Boolean,
                    value: function() {
                      return false;
                    },
                  },

                  // TODO(scottchen): get data from kiosk setting
                  // (settings.hasAutoLaunchApp)
                  canEditBailout_: {
                    type: Boolean,
                    value: function() {
                      return true;
                    },
                  },

                  apps:
                      {
                        type: Array,
                        // TODO(scottchen): replace stub data with real data.
                        value:
                            function() {
                              return [
                                {
                                  autoLaunch: true,
                                  iconURL:
                                      'data:image/png;base64,',
                                  id: 'hbamjgonkkndpkmabppdnoilelahlihn',
                                  isLoading: false,
                                  name: 'AO Collective'
                                },
                                {
                                  autoLaunch: false,
                                  iconURL:
                                      'data:image/png;base64,',
                                  id: 'jhakaggbplnmbjcchakoncckailahjhj',
                                  isLoading: false,
                                  name: 'Tweetwall'
                                },
                                {
                                  autoLaunch: false,
                                  iconURL:
                                      'data:image/png;base64,',
                                  id: 'jhakaggbplnmbjcchakoncckailahjhj',
                                  isLoading: false,
                                  name: 'Tweetwall'
                                },
                                {
                                  autoLaunch: false,
                                  iconURL:
                                      'data:image/png;base64,',
                                  id: 'jhakaggbplnmbjcchakoncckailahjhj',
                                  isLoading: false,
                                  name: 'Tweetwall'
                                },
                                {
                                  autoLaunch: false,
                                  iconURL:
                                      'data:image/png;base64,',
                                  id: 'jhakaggbplnmbjcchakoncckailahjhj',
                                  isLoading: false,
                                  name: 'Tweetwall'
                                },
                                {
                                  autoLaunch: false,
                                  iconURL:
                                      'data:image/png;base64,',
                                  id: 'jhakaggbplnmbjcchakoncckailahjhj',
                                  isLoading: false,
                                  name: 'Tweetwall'
                                }
                              ];
                            },
                      }
                },

            /** @private {?extensions.KioskBrowserProxy} */
            kioskBrowserProxy_: null,

            attached: function() {
              this.kioskBrowserProxy_ =
                  extensions.KioskBrowserProxyImpl.getInstance();
            },

            show: function() {
              this.$.dialog.showModal();
            },

            /** @private */
            onAddAppTap_: function() {
              this.kioskBrowserProxy_.addKioskApp(this.addAppId_).then(() => {
                // TODO(scottchen): update list? make another listener to update
                // list?
                this.addAppId_ = null;
                // TODO(scottchen): if not valid, show invalid message in UI
              });
            },

            onAutoLaunchButtonTap_: function(e) {
              const app = e.model.item;
              let promise;

              if (app.autoLaunch) {  // If the app is originally set to
                                     // auto-launch.
                promise =
                    this.kioskBrowserProxy_.disableKioskAutoLaunch(app.id);
              } else {
                promise = this.kioskBrowserProxy_.enableKioskAutoLaunch(app.id);
              }

              promise.then(
                  () => {
                      // TODO(scottchen): update UI?
                  });
            },

            onBailoutTap_: function(e) {
              e.preventDefault();
              if (this.bailoutEnabled_) {
                this.kioskBrowserProxy_.setDisableBailoutShortcut(false).then(
                    () => {
                      this.bailoutEnabled_ = false;
                      this.$['confirm-dialog'].close();
                    });
              } else {
                this.$['confirm-dialog'].showModal();
              }
            },

            onBailoutDialogCancelTap_: function() {
              this.$['confirm-dialog'].cancel();
            },

            /** @private */
            onBailoutDialogConfirmTap_: function() {
              this.kioskBrowserProxy_.setDisableBailoutShortcut(true).then(
                  () => {
                    this.bailoutEnabled_ = true;
                    this.$['confirm-dialog'].close();
                  });
            },

            /** @private */
            onDoneTap_: function() {
              this.$.dialog.close();
            },

            onDeleteAppTap_: function(e) {
              this.kioskBrowserProxy_.removeKioskApp(e.model.item.id)
                  .then(
                      () => {
                          // TODO(scottchen): update list? make another listener
                          // to update list?
                      });
            },

            getAutoLaunchButtonLabel_: function(
                autoLaunched, disableStr, enableStr) {
              return autoLaunched ? disableStr : enableStr;
            },
          });

      return {
        KioskDialog: KioskDialog,
      };
    });
